import React, {useState, useEffect} from "react";
import {Link, useParams } from "react-router-dom";
import axios from "axios";

function Home({ user, Logout }) {
  const APIUrl = "http://34.222.245.107:5000/api";
  const [question, setQuestion] = useState("");
  var data = {
    question: question
  }
  useEffect(() => {
    axios
      .get(`${APIUrl}/c`)
      .then(
        (response) => {
          setQuestion(response.data);
        },
        (reject) => {
          console.log(reject);
        }
      )
      .catch((err) => {
        console.error(err);
      });
  }, []);

  let content = null

  if(question.error) {
    content = <p> There was an error </p>
  }

  if(question.data) {
    content  = <div>
      <h1>No question</h1>
    </div>
  }

  return (
    <div>
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <div className="container-fluid">
          <h2>
            Welcome, <span>{user.firstname}</span>
          </h2>
          <button type="button" aria-expanded="false">
            <Link to="/feedback"><span>Feedback </span> </Link>
          </button>
        </div>
        <button type="button" aria-expanded="false"></button>
            <Link to="/question"><span>Feedback </span> </Link>
        <button onClick={Logout}> <Link to="">Logout</Link></button>
      </nav>
      <div>
        <h1>
          Please select an option to start the interview!
        </h1>
        {content}

      </div>

    </div>
  );
}

export default Home;
